import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      items: ["apples", "pears", "oranges"]
    };
  }

  render() {
    return (
      <div className="main">
        {this.state}
      </div>
    )
  }
}

export default App;
